import { useState } from "react";
import { Button } from 'react-bootstrap';

export default function Register({ register, setIsLogin }) {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [firstname, setFirstname] = useState("");
  const [lastname, setLastname] = useState("");

  const handleRegister = () => {
    let registered = register(username, password, firstname, lastname);
    if (registered) {
        const success = ""
        alert('Regist Successful!');
    }
  };

  return (
    <div>
      <h3>Register</h3>
      <label>
        Username:
        <input value={username} onChange={(e) => setUsername(e.target.value)} /><br/>
      </label>
      <label>
        Password:
        <input value={password} onChange={(e) => setPassword(e.target.value)} /><br/>
      </label>
      <label>
        First name:
        <input
          value={firstname}
          onChange={(e) => setFirstname(e.target.value)}
        /><br/>
      </label>
      <label>
        Last name:
        <input value={lastname} onChange={(e) => setLastname(e.target.value)} /><br/>
      </label>
      <button onClick={() => handleRegister()}>register</button>
      <button onClick={() => setIsLogin(true)}>login</button>
    </div>
  );
}
